import React from 'react';
import Header from './Header'; // Ensure the path is correct
import MainSection from './MainSection'; // Import the MainSection component
import AfterMain from './AfterMain'; // Import the AfterMain component
import './App.css'; // Ensure the path is correct based on your folder structure
import SalesSection from './SalesSection'; // Import the new SalesSection

function App() {
  return (
    <div className="App">
      <Header />
      <MainSection />  {/* This will show the background image */}
      <AfterMain />    {/* This will show the vehicle icons and filters */}
      <SalesSection /> {/* This will show the Most sold vehicles this month */}
    </div>
  );
}

export default App;
